import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { collecting, letGet } from "./Bridge";

export const Athlets=()=>{
    const{position}=useParams()
    const [tournament,setTournament]=useState({
        "tournamentId":0,
        "name":"",
        "startDate":"",
        "venue":"",
        "price":0,
        "participants":[]
    })
    useEffect(()=>{
        gather()
        found()
    },[])

    const gather=async()=>{
        const t = await collecting()
        setTournament(t.data[position])
    }

    const found=async()=>{
        alert("before to find athlets"+JSON.stringify(tournament))
        const t = await letGet(tournament)
        alert(JSON.stringify(t.data))
    }

    return(
        <>
            <p>{tournament.name}</p>
        </>
    );
}
